import React from 'react';
import './styles/AboutUs/AboutUs.css'
import Title from './UI/Title/Title';

const AboutUs = () => {
    return (
        <div className='AboutUs'>
            <Title hType="h1">немного о нас</Title>
            <div className="AboutUs__content">
                <div className="AboutUs__content__head">
                    <div className="AboutUs__content__head__block">
                        <div className="AboutUs__content__head__block__text"></div>
                        <div className="AboutUs__content__head__block__subtext"></div>
                    </div>
                </div>
                <div className="AboutUs__content__foot"></div>
            </div>
        </div>
    );
};

export default AboutUs;
